import React, { Component, Fragment } from 'react'
import Header from '../../components/Header'
import Post from '../../components/Post';
import { PostDetails } from '../../type/PostDetails';
import './profile.css'

type ProfileProps = {};

type ProfileState = {
  postList: PostDetails[];
}

export default class Profile extends Component<ProfileProps, ProfileState> {
  constructor(props: HomeProps) {
    super(props);
    this.state = {
      postList: [
        {
          id: "1",
          title: "First Post",
          description: "This is first post on wall",
          hoursCount: 8,
          lecturerName: "Sanu",
          tag: ["Introduction"],
        },
        {
          id: "2",
          title: "Second Post",
          description: "This is Second post on wall",
          hoursCount: 8,
          lecturerName: "Yashith",
          tag: ["React", "TypeScrypt"],
        },
        {
          id: "3",
          title: "Third Post",
          description: "This is Third post on wall",
          hoursCount: 4,

          tag: ["TailwindCss", "NodeJs", "MongoDB"],
        },
      ],
    };
  }
  render() {
    return (
      <Fragment>
        <Header/>
        <div className='mt-20 p-6'>
          <Post
          key="Samantha"
          title="this.props.title"
          description="this.props.description"
          tags={["Tag1", "Tag2", "Tag3", "Tag4"]}
          />
        </div>
      </Fragment>
    );
  }
}
